import React from "react";
import {Form, Checkbox } from "../form/inputs";
import {Button} from "../form/buttons/primary-button";
import Image from "./image";
import styled from "styled-components";
import {PhoneInput} from "../form/input-fields/phone-input";

const ContentWrapper = styled("div")`
  display: grid;
  grid-template-columns: 455px 60%;
`;

const CustomButton = styled(Button)`
  margin-bottom:40px;
`;

const NavLink = styled.a`
  font-weight: 600;
  font-size: 14px;
  line-height: 19px;
  text-align: center;
  color: #A02167;
  margin-top:0px;
  padding:0px 0px;
  text-decoration:none;

`;

const Title = styled("h3")`
font-family: Open Sans;
font-style: normal;
font-weight: 600;
font-size: 20px;
line-height: 27px;
padding-bottom: 20px;

/* Black / 444 */

color: #444444;
`;

const SubTitle = styled("p")`
font-family: Open Sans;
font-style: normal;
font-weight: normal;
font-size: 14px;
line-height: 19px;

/* Black / 444 */

color: #444444;
`;

const FormContainer = styled(Form)`
  padding: 0px 20px;
  position: relative;
`;

const FlexContainer = styled("div")`
display: flex;
`;
const CenteredForm = styled("div")`

  margin: 0;
  position: absolute;
  top: 50%;
  left: 50%;
  -ms-transform: translate(-50%, -50%);
  transform: translate(-50%, -50%);

`;
const Avatar = styled("img")`
height:22px;
width:15px;
padding:0px 5px 0px 20px ;

`;
const CheckBoxContainer = styled("div")`
margin: 20px 0px;

`;

const HeaderContainer = styled("div")`
padding-bottom:60px;

`;

const ContentContainer = styled("div")`


`;



const Login = () => {
  return (
    <>
      <ContentWrapper>
        <Image />
        <FormContainer>
          <CenteredForm>
            <HeaderContainer>
            <Title>Welcome to Taxiye!</Title>
            <SubTitle>Please enter your mobile phone number. We’ll send you a text to verify your phone.</SubTitle>
            </HeaderContainer>
            <ContentContainer>
            <PhoneInput
              label="Phone Number *"
              placeholder="your phone number"
              id="phone"/>
            <CheckBoxContainer>
              <Checkbox id="1" placeholder="Keep me signed in" />
            </CheckBoxContainer>
            <CustomButton>Next</CustomButton>
            <FlexContainer>
              <SubTitle>Problem with your account?</SubTitle>
              <FlexContainer>
                <Avatar src={require("../../assets/icons/main-search.svg")} />
                <NavLink href="/">Support Center</NavLink>
              </FlexContainer>
            </FlexContainer>
            </ContentContainer>
          </CenteredForm>
        </FormContainer>
      </ContentWrapper>
    </>
  );
};

export default Login;
